O PRESENTE TERMO DE COMPROMISSO TEM POR OBJETIVO PROPICIAR A CONCESSÃO DE LINHAS DE CRÉDITO IMOBILIÁRIO PELA POUPEX, SOB CONDIÇÕES FAVORECIDAS E MEDIANTE A CONSIGNAÇÃO DO VALOR DAS PRESTAÇÕES DEVIDAS PELO MUTUÁRIO EM FOLHA DE PAGAMENTO, AOS SERVIDORES ATIVOS, INATIVOS E PENSIONISTAS, CONCEDIDOS DENTRO DAS REGRAS DO SISTEMA BRASILEIRO DE HABITAÇÃO ESTABELECIDAS PELO BANCO CENTRAL DO BRASIL, NAS MODALIDADES ABAIXO ENUMERADAS:

A) AQUISIÇÃO DE IMÓVEL RESIDENCIAL;

B) AQUISIÇÃO DE IMÓVEL COMERCIAL;

C) AQUISIÇÃO DE TERRENO;

D) AQUISIÇÃO DE MATERIAL DE CONSTRUÇÃO;

E) CRÉDITO COM GARANTIA DE IMÓVEL.
